import "./App.css";
import Header from "./components/header";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Routes,
} from "react-router-dom";
import HomePages from "./pagecontent/HomePages";
import Home from "./components/homes/Home";

function App() {
  return (
    <>
      <Router>
        <Header />
        <Home />
        <Routes>
          <Route path="/" exact element={<HomePages />} />
        </Routes>
      </Router>
    </>
  );
}

export default App;
